import React from 'react'
import Chat from './components/Chat';
import Room from './components/Room';
import './App.css';


function App(roomId){
  return (
    <div className="App">
      {roomId !== '' ? 
      <Chat roomId={roomId}/>
      : <Room/>}
    </div>
  )
}

export default App
